pragma solidity ^0.8.0; 

contract IfElse{
 function largestNumber(uint num1,uint num2) public pure returns(uint){
     if (num1>num2){
         return num1;
     }
     else if(num2>num1){
         return num2;
     }
     else{
         return num1;
     }

 }
 function ternary(uint num1,uint num2) public pure returns(uint){
    return (num1>num2)? num1 : num2;
 }

}

